<div style="text-align: center; padding: 100px 0 0">
    Hover me!
</div>


<script src="https://ajax.googleapis.com/ajax/libs/jquery/3.2.1/jquery.min.js"></script>

<script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/1.20.3/TweenMax.min.js"></script>

<script>

    function shuffle (array) {
        var i = 0
            , j = 0
            , temp = null

        for (i = array.length - 1; i > 0; i -= 1) {
            j = Math.floor(Math.random() * (i + 1))
            temp = array[i]
            array[i] = array[j]
            array[j] = temp
        }
    }


    function calculateAngle(x, y) {
        var k = Math.abs(y) / Math.abs(x);
        var angle = Math.atan(k) * 180 / Math.PI;
        if (y * x > 0) {
            angle = 90 - angle + (y < 0 ? 180 : 0);
        } else {

            if (x < 0) {
                angle = angle + (y < 0 ? 90 : 270);
            }

            else {
                angle = angle + (y <= 0 ? 90 : 270);
            }
        }
        return angle;
    }

    function getRandomInt(min, max) {
        return Math.floor(Math.random() * (max - min)) + min;
    }


    var svg = document.querySelector('svg');

    var svg_box = svg.viewBox.baseVal;

    var poolRadius = 200;

    var particles = [];


    $('svg g *').each(function () {

        var path_box = $(this)[0].getBBox()

        particles.push({
            element: $(this)[0],
            x: path_box.x,
            y: path_box.y
        });
    });


    function svg_animation() {

//        TweenMax.to('svg', 5, {
//            rotation: '+=360',
//			repeat: -1,
//            ease: Linear.easeNone,
//            delay: 0.3
//
//        });

        function get_random_rotation_string() {
            var random_rotation = getRandomInt(720, 1400);
            var random_rotate_direction = getRandomInt(-1, 1);

            var random_rotate_direction_string;

            if (random_rotate_direction == -1) {
                random_rotate_direction_string = '+=';
            }
            else {
                random_rotate_direction_string = '-=';
            }

            return random_rotate_direction_string + random_rotation;
        }

        function generate_point_arr(item) {

            var path_location_x = item.x - svg_box.width / 2;
            var path_location_y = svg_box.height / 2 - item.y;

            var angle = calculateAngle(path_location_x, path_location_y);

            var points_arr = [];

            var angle_shift = 0;

            for (var points_count = 0; points_count < 4; points_count++) {

                var random_shift = getRandomInt(-50, 50);

                var radius = poolRadius + random_shift;

                points_arr.push({
                    x: (Math.cos((angle + angle_shift - 90) * (Math.PI / 180)) * radius) - path_location_x,
                    y: (Math.sin((angle + angle_shift - 90) * (Math.PI / 180)) * radius) + path_location_y
                });

                angle_shift += 90;
            }

            return points_arr;
        }


        function ring_animation() {

            particles.forEach(function (item) {

                var points_arr = generate_point_arr(item);

                var random_duration = getRandomInt(5, 10);


                var bizier_values = [
                    {x: points_arr[1].x, y: points_arr[1].y},
                    {x: points_arr[2].x, y: points_arr[2].y},
                    {x: points_arr[3].x, y: points_arr[3].y},
                    {x: points_arr[0].x, y: points_arr[0].y}
                ];



                move_around_tween(bizier_values);

                function move_around_tween(bizier_values) {

                    item.move_around_tween_tw = TweenMax.to(item.element, random_duration,
                        {
                            bezier: {
                                curviness: 1.5,
                                values: bizier_values
                            },
                            ease: Linear.easeNone,
                            rotation: get_random_rotation_string(),
                            onComplete: move_around_tween
                        });

                }

            });
        }


//        move_around_tween_tw.play();


        $('svg').hover(function () {
            ring_animation();

        }, function () {

            particles.forEach(function (item) {

                item.move_around_tween_tw.pause();

                TweenMax.to(item.element, 1, {
                    x: 0,
                    y: 0,
                    rotation: 0,
                    delay: 0.3
                });
            });
        });
    }

    svg_animation();


</script>

</body>
